import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav className="bg-blue-600 p-4 text-white">
      <div className="container mx-auto flex justify-between items-center">
        <Link to="/" className="text-xl font-bold">Student Portal</Link>
        <div className="space-x-4">
          <Link to="/" className="hover:text-blue-200">Home</Link>
          <Link to="/signup" className="hover:text-blue-200">Sign Up</Link>
          <Link to="/about" className="hover:text-blue-200">About Us</Link>
          <Link to="/dashboard" className="hover:text-blue-200">Student Dashboard</Link>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
